import React from "react"
import { Box } from "@chakra-ui/react"
import { useState, useEffect } from "react"

function Todos(){
    const [todos, setTodos] = useState([{"id": 1, "item": "Hello"}])
      // useEffect(() => {
    //   getCurrentTodos
    // })

    return (
        <Box>
            <ul>
                {todos.map(element => <li>{element.id}: {element.item}</li>)}
            </ul>
        </Box>
    )
}

export default Todos
